css:
.event, .dhx_cal_tab.active, .dhx_cal_tab.active:hover {background-color: #00876C;} .dhx_month_head, .dhx_cal_tab, .dhx_cal_today_button {color: #00876C;} .dhx_cal_tab, .dhx_cal_tab.active {border-color: #00876C;}
.dhx_after .dhx_month_body, .dhx_before .dhx_month_body, .dhx_after .dhx_month_head, .dhx_before .dhx_month_head { background-color: #f7f7f7; }
.dhx_cal_qi_controls {
    display: none;
}

.dhtmlXTooltip {
    display: none;
}

.dhx_cal_qi_title {
    background-color: #00876C;
}

.dhx_cal_tab, .dhx_cal_event_clear {
    color: #00876C;
}

.active {
    background-color: #00876C;
    color: white;
}
.dhx_cal_event_clear {
    background-color: transparent;
}

.dhx_cal_prev_button, .dhx_cal_next_button, .dhx_event_icon {
    filter: brightness(0) saturate(100%) invert(27%) sepia(81%) saturate(3067%) hue-rotate(155deg) brightness(90%) contrast(101%);
}
